import React from 'react';
import ReactDom from 'react-dom';
import './index.css';

function BookList(){
  return(
    <section className="bookList">
      <div>
        <Book/>
        <Book/>
        <Book/>
      </div>
    </section>
  )
}


const author = 'Héctor García'
const Book = () =>{
  const title = 'Ikigai';
  return (
    <article className='Book'>
       <img src="https://images-na.ssl-images-amazon.com/images/I/51T8OXMiB5L._SX356_BO1,204,203,200_.jpg" title="" />
      <h1>{title}</h1>
      <h4>{author}</h4>
      <p>{6+6}</p>
    </article>
  )
}

ReactDom.render(<BookList/>,document.getElementById('root'))
